import React from 'react';
import './NavTab.css';

function NavTab() {
    return (
        <section className="navTab">
            <h1 className="navTab__title">Учебный проект студента факультета Веб-разработки.</h1>
            <div className="header__buttons">
                <button className="header__button" aria-label="Кнопка регистрации" type="button">Регистрация</button>
                <button className="header__button-green" aria-label="Кнопка войти" type="button">Войти</button>
            </div>

            <ul class="header__lang-links">
                <li><a href="#" class="header__lang-link header__lang-link_active">Ru</a></li>
                <li><a href="#" class="header__lang-link">En</a></li>
            </ul>
        </section>
    );
}

export default NavTab;
